import { React, useState, useEffect } from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardHeader,
  MDBCardFooter,
  MDBBtn,
} from "mdb-react-ui-kit";
import { renderMatches } from "react-router-dom";

export default function NotificationToast(props) {

    render (
    <Toast
        className="mb-2"
        bg="light"
        style={{ width: "100%" }}
      >
        <Toast.Header>
          <strong className="me-auto">Auftrags-ID 18</strong>
          <small>11 mins ago</small>
        </Toast.Header>
        <Toast.Body>
          Hello, world! This is a toast notification.
        </Toast.Body>
      </Toast>



    )
}
